GPIO Interfaces exposed by the HAL should provide dedicated zero-sized types for each pin on every interface or port, resulting in a zero-cost GPIO abstraction when all pin assignments are statically known. Each GPIO Interface or Port should implement a split method returning a struct with every pin. Example: pub struct PA0;
pub struct PA1;
// ... pub struct PortA; impl PortA { pub fn split(self) -> PortAPins { PortAPins { pa0: PA0, pa1: PA1, // ... } }
} pub struct PortAPins { pub pa0: PA0, pub pa1: PA1, // ...
