Pins should provide type erasure methods that move their properties from compile time to runtime, and allow more flexibility in applications. Example: /// Port A, pin 0.
pub struct PA0; impl PA0 { pub fn erase_pin(self) -> PA { PA { pin: 0 } }
} /// A pin on port A.
pub struct PA { /// The pin number. pin: u8,
} impl PA { pub fn erase_port(self) -> Pin { Pin { port: Port::A, pin: self.pin, } }
} pub struct Pin { port: Port, pin: u8, // (these fields can be packed to reduce the memory footprint)
} enum Port { A, B, C, D,
}

