Pins may be configured as input or output with different characteristics depending on the chip or family. This state should be encoded in the type system to prevent use of pins in incorrect states. Additional, chip-specific state (eg. drive strength) may also be encoded in this way, using additional type parameters. Methods for changing the pin state should be provided as into_input and into_output methods. An erase_state method for erasing the type information (replacing it with an Unknown type) should be provided for making pins in different states interoperable. Additionally, with_{input,output}_state methods should be provided that temporarily reconfigure a pin in a different state without moving it. The following methods should be provided for every pin type (that is, both erased and non-erased pin types should provide the same API): pub fn into_input<N: InputState>(self, input: N) -> Pin<N> pub fn into_output<N: OutputState>(self, output: N) -> Pin<N> pub fn erase_state(self) -> Pin<Unknown> pub fn with_input_state<N: InputState, R>( &mut self, input: N, f: impl FnOnce(&mut PA1<N>) -> R,
) -> R pub fn with_output_state<N: OutputState, R>( &mut self, output: N, f: impl FnOnce(&mut PA1<N>) -> R,
) -> R Pin state should be bounded by sealed traits. Users of the HAL should have no need to add their own state. The traits can provide HAL-specific methods required to implement the pin state API. Example: # use core::mem::PhantomData;
mod sealed { // ...
} pub trait PinState: sealed::Sealed {}
pub trait OutputState: sealed::Sealed {}
pub trait InputState: sealed::Sealed { // ...
} pub struct Unknown; impl PinState for Unknown {} pub struct Output<S: OutputState> { _p: PhantomData<S>,
} impl<S: OutputState> PinState for Output<S> {} pub struct PushPull;
pub struct OpenDrain; impl OutputState for PushPull {}
impl OutputState for OpenDrain {} pub struct Input<S: InputState> { _p: PhantomData<S>,
} impl<S: InputState> PinState for Input<S> {} pub struct Floating;
pub struct PullUp;
pub struct PullDown; impl InputState for Floating {}
impl InputState for PullUp {}
impl InputState for PullDown {} pub struct PA1<S: PinState> { _p: PhantomData<S>,
} impl<S: PinState> PA1<S> { pub fn into_input<N: InputState>(self, input: N) -> PA1<N> { todo!() } pub fn into_output<N: OutputState>(self, output: N) -> PA1<N> { todo!() } pub fn with_input_state<N: InputState, R>( &mut self, input: N, f: impl FnOnce(&mut PA1<N>) -> R, ) -> R { todo!() } pub fn with_output_state<N: OutputState, R>( &mut self, output: N, f: impl FnOnce(&mut PA1<N>) -> R, ) -> R { todo!() } pub fn erase_state(self) -> PA1<Unknown> { todo!() }
